    "region-9-npdes-facilities",nt"isopen": false,nt"url": null,nt"notes":
    "Point geospatial dataset representing locations of NPDES Facilities. NPDES (National
    Pollution Discharge Elimination System) is an EPA permit program that regulates
    direct discharges from facilities that discharge treated waste water into waters
    of the US. Facilities are issued NPDES permits regulating their discharge as required
    by the Clean Water Act. A facility may have one or more outfalls (dischargers).
    The location represents the facility or operating plant.",nt"license_title":
